package gameserver;public class NewGameRequest {    private ServerConnector ServerConnector;    public NewGameRequest(ServerConnector sc) {        super();        this.ServerConnector = sc;    }    public byte[] Serialize() {        byte[] out = new byte[256];        out[0] = 0x4E;        out[1] = 0x47;        for (int x = 2; x < 256; x++) {            out[x] = (byte) 0x1A;        }        return out;    }}